(function() {
    'use strict';

    // Replace the XPath in the following line with the one you want to search and delete
    var xpathToRemove = "/html/body/div/div/div[3]/div[2]/section/div[2]/div/div/div[1]/div/img[2]";

    function removeImagesByXPath() {
        // Select the target node
        var targetNode = document.evaluate(xpathToRemove, document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;

        if (targetNode) {
            // If the target node is found, remove it
            targetNode.parentNode.removeChild(targetNode);
        }
    }

    // Function to run the script every 2 seconds
    function runScriptInterval() {
        removeImagesByXPath();
    }

    // Run the script immediately
    runScriptInterval();

    // Set up an interval to run the script every 2 seconds
    setInterval(runScriptInterval, 2000);
})();